import React, { useState } from 'react';

const AccountTab = ({ profile, onAccountUpdate, onLogout, ConfirmDialog }) => {
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [isDialogOpen, setIsDialogOpen] = useState(false);

  const handleCancelSubscription = async () => {
    console.log('handleCancelSubscription called');
    setIsLoading(true);
    setError('');
    setSuccess('');
    try {
      const response = await fetch('/api/subscription/cancel', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          // Add any necessary authentication headers here
        },
      });
      const data = await response.json();
      
      if (!response.ok) {
        throw new Error(data.message || 'Failed to cancel subscription');
      }

      console.log('Subscription cancellation response:', data);
      setSuccess(`Your subscription has been cancelled. You will have access to premium features until ${new Date(data.cancelAt).toLocaleDateString()}.`);
      onAccountUpdate(); // Refresh the profile data
      setIsDialogOpen(false);
    } catch (err) {
      console.error('Error cancelling subscription:', err);
      setError(err.message || 'An error occurred while cancelling the subscription.');
    } finally {
      setIsLoading(false);
    }
  };

  const openCancelDialog = () => {
    console.log('Opening cancel dialog');
    setIsDialogOpen(true);
  };

  console.log('Current dialog state:', isDialogOpen);

  return (
    <div className="space-y-6 text-white">
      <h2 className="text-2xl font-bold">Account Details</h2>
      <p><strong>Subscription Tier:</strong> {profile.subscriptionTier}</p>
      <p><strong>Subscription Status:</strong> {profile.subscriptionActive ? 'Active' : 'Inactive'}</p>
      
      {profile.subscriptionActive && !profile.cancellationRequested && (
        <button
          className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700 disabled:opacity-50"
          onClick={openCancelDialog}
          disabled={isLoading}
        >
          {isLoading ? 'Processing...' : 'Cancel Subscription'}
        </button>
      )}

      {/* Inline dialog for testing */}
      {isDialogOpen && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded-lg text-black">
            <h2 className="text-xl font-bold mb-4">Are you sure you want to cancel?</h2>
            <p className="mb-4">Your subscription will be cancelled at the end of the current billing cycle. You will continue to have access to premium features until then.</p>
            <div className="flex justify-end space-x-2">
              <button 
                onClick={() => setIsDialogOpen(false)} 
                className="px-4 py-2 bg-gray-300 rounded hover:bg-gray-400"
              >
                No, keep my subscription
              </button>
              <button 
                onClick={handleCancelSubscription} 
                className="px-4 py-2 bg-red-600 text-white rounded hover:bg-red-700"
              >
                Yes, cancel subscription
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Original ConfirmDialog component */}
      {ConfirmDialog && (
        <ConfirmDialog
          isOpen={isDialogOpen}
          title="Are you sure you want to cancel?"
          message="Your subscription will be cancelled at the end of the current billing cycle. You will continue to have access to premium features until then."
          onConfirm={handleCancelSubscription}
          onCancel={() => {
            console.log('Dialog cancelled');
            setIsDialogOpen(false);
          }}
        />
      )}

      {error && (
        <div className="bg-red-600 text-white p-4 rounded-md">
          <strong>Error:</strong> {error}
        </div>
      )}

      {success && (
        <div className="bg-green-600 text-white p-4 rounded-md">
          <strong>Success:</strong> {success}
        </div>
      )}
      
      <div className="mt-8">
        <h3 className="text-xl font-semibold mb-4">Danger Zone</h3>
        <button 
          onClick={() => {
            console.log('Delete Account clicked');
            /* Implement account deletion logic */
          }}
          className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700"
        >
          Delete Account
        </button>
      </div>
    </div>
  );
};

export default AccountTab;
